import React from 'react';
import './profile.css';

function Profile() {
    return (
        <div >
            <div className="pf-logo">logo</div>
            <p className='pf-name'>pf-name</p>
            <div className="followers">
                <button>followers</button>
                <button>following</button>
            </div>
            <div className="frds">
                your frds
            </div>
        </div>
    );
}

export default Profile;
